export const lightTheme = {
  body: "#fafafa",
  text: "#363537",
  toggleBorder: "#FFF",
  gradient:
    "linear-gradient(90deg, hsla(277, 75%, 84%, 1) 0%, hsla(297, 50%, 51%, 1) 100%)",
};

export const darkTheme = {
  body: "#333",
  text: "#FAFAFA",
  toggleBorder: "#6B8096",
  gradient:
    "linear-gradient(90deg, hsla(216, 41%, 79%, 1) 0%, hsla(186, 33%, 94%, 1) 100%)",
